import React from "react";
import { useHistory } from "react-router-dom";
import '../../styles.css';

export default function landing() {

  return (
    <div className="main">
      <div className="heading"><h2>HOME PAGE</h2></div>  
      <div className="loginbutton">
      <button type="submit" className="btn btn-primary w-30 theme-btn mx-auto">
        Log In / Sign Up
      </button></div>
      <img src="landing_page.jpg" width='1450' height='700'></img>
    </div>
  );
}
